import Api from '../../api'


// getJson(4, 'x')



function getJson(id, type) {
    let data = {
        "static": "",
        "fakeData": ""
    }
    Api('c=game&a=initCaiZhong&game_key=' + type + '&lottery_id=' + id + '&historyLimit=8', null, (res) => {
        const initData = res.data.methods;
        console.log(initData)
        //本地储存staticData  静态数据
        let staticData = {}
        initData.map(mg => {
            mg.childs.map((method, m) => {
                staticData[method.name] = {
                    "method_id": method.method_id,
                    "name": method.name,
                    "cname": method.cname,
                    "mg_name": method.mg_name,
                    "field_def": method.field_def,
                    "can_input": method.can_input,
                    "levels": method.levels,
                    "method_property": method.method_property,
                    "prize": method.prize,
                    "num_level": method.num_level
                }
            })
        })

        data.static = staticData;
        if (data.static && data.fakeData) {
            console.log(JSON.stringify(data))
        }
    })
    Api('c=game&a=initCaiZhong2&game_key=' + type + '&lottery_id=' + id + '&historyLimit=8', null, (res) => {
        const initData = res.data.methods;
        // //虚拟数据
        let fakeData = JSON.parse(JSON.stringify(initData));
        initData.map((mg, m) => {
            let arr = []
            mg.childs.map(item => {
                arr.push({
                    "method_id": item.method_id,
                    "name": item.name,
                    "cname": item.cname,
                    "can_input": item.can_input,
                    "prize": item.prize,
                })
            })
            fakeData[m].childs = arr
        })
        data.fakeData = fakeData
        if (data.static && data.fakeData) {
            console.log(JSON.stringify(data))
        }
    })
}

